nodes.caption:
Reprocess from one of the most epic locations I have shot at. This was a 3x3 grid panoramic image, stitched in PTGui and then straightened and tidied up in PS (orbs and dust). The upper half of the tower was much brighter in the original shots and was blown out, so I created another pano on the platform above and then cut masks in the 8 windows looking through into the top half and dropped the correctly exposed details back in. Well worth all the effort.
Pentax 645Z
Manfrotto 55 Carbon

